// traffic lights rules
	function getTrafficLight(tl,v){
		
		var result;
	//yesgreen
		if (tl == "yesgreen"){
			if (v == "yes" || v == "Yes") {
				result= "success"
			}
			else if (v == "no" || v == "No") {
				result= "danger"
			}
			else {
				result= "none"
			}
		}
	//nogreen
		else if (tl == "nogreen"){
			if (v == "yes" || v == "Yes") {
				result= "danger"
			}
			else if (v == "no" || v == "No") {
				result= "success"
			}
			else {
				result= "none"
			}
		}
	//nonered
		else if (tl == "nonered"){
			if (v == "none" || v == "unknown" || v == "None" || v == "Unknown" || v == "No" || v == "no") {
				result= "danger"
			}
			else {
				result= "success"
			}
		}
	//percentagegreen
		else if (tl == "percentagegreen"){
			if (v == "more_75%" || v == "more 75%" || v == "More than 75%") {
				result= "success"
			}
			else if (v == "btw_50%_75%" || v == "btw 50% 75%" || v == "Between 50% and 75%") {
				result= "warning"
			}
			else {
				result= "danger"
			}
		}
	//percentagered
	else if (tl == "percentagered"){
			if (v == "more_75%" || v == "more 75%" || v == "More than 75%") {
				result= "danger"
			}
			else if (v == "btw_50%_75%" || v == "btw 50% 75%" || v == "btw 25% 50%" || v == "btw_25%_50%" || v == "Between 50% and 75%" || v == "Between 25% and 50%") {
				result= "warning"
			}
			else {
				result= "success"
			}
		}
	//no rule
		else {
			result= "none"
		}
		return result;
		
	}
	
